const checkWin = () => {
  let flag = true;

  for (let x = 0; x < appMc.cellsColumnsAmount; x++) {
    for (let y = 0; y < appMc.cellsColumnsAmount; y++) {
      const obj = appMc.cellsContainer[x][y];

      if (
        obj &&
        obj.realX &&
        obj.realY &&
        (obj.realX !== x || obj.realY !== y)
      ) {
        flag = false;
      }
    }
  }

  if (flag) {
    gameScore++;
    return true;
  }

  return false;
};

const moveCell = (obj, x, y) => {
  if (!obj) {
    return;
  }

  const realX = obj.realX;
  const realY = obj.realY;

  if (
    (realX - 1 === appMc.emptyCellIndexX && realY === appMc.emptyCellIndexY) ||
    (realX + 1 === appMc.emptyCellIndexX && realY === appMc.emptyCellIndexY) ||
    (realX === appMc.emptyCellIndexX && realY - 1 === appMc.emptyCellIndexY) ||
    (realX === appMc.emptyCellIndexX && realY + 1 === appMc.emptyCellIndexY)
  ) {
    appMc.cellsContainer[x][y].x =
      appMc.emptyCellIndexX * (appMc.cellsSize + appMc.gridGap);
    appMc.cellsContainer[x][y].y =
      appMc.emptyCellIndexY * (appMc.cellsSize + appMc.gridGap);

    appMc.emptyCellContainer.x = realX * (appMc.cellsSize + appMc.gridGap);
    appMc.emptyCellContainer.y = realY * (appMc.cellsSize + appMc.gridGap);

    obj.realX = appMc.emptyCellIndexX;
    obj.realY = appMc.emptyCellIndexY;

    appMc.emptyCellIndexX = realX;
    appMc.emptyCellIndexY = realY;
  }
};

const handlePointerUp = (obj, x, y) => {
  if (appMc.gameStarted) {
    moveCell(obj, x, y);

    if (checkWin()) {
      appMc.mcEnding.visible = true;
    }
  }
};

const shuffleCells = () => {
  for (let k = 0; k < 100 * appMc.cellsDifficlty; k++) {
    const x = Math.floor(Math.random() * appMc.cellsColumnsAmount);
    const y = Math.floor(Math.random() * appMc.cellsRowsAmount);

    moveCell(appMc.cellsContainer[x][y], x, y);
  }

  if (checkWin()) {
    shuffleCells();
  }
};

const initCell = (x, y) => {
  appMc.cellsContainer[x][y] = new createContainer({
    p: appMc.mcGrid,
    x: x * (appMc.cellsSize + appMc.gridGap),
    y: y * (appMc.cellsSize + appMc.gridGap),
  });
  appMc.cellsContainer[x][y].realX = x;
  appMc.cellsContainer[x][y].realY = y;
  appMc.cellsContainer[x][y].interactive = true;
  appMc.cellsContainer[x][y].on("pointerup", () =>
    handlePointerUp(appMc.cellsContainer[x][y], x, y)
  );

  appMc.cells[x][y] = new createRect({
    p: appMc.cellsContainer[x][y],
    x: 0,
    y: 0,
    width: appMc.cellsSize,
    height: appMc.cellsSize,
    color: 0x2244aa,
    alpha: 1,
    fill: 1,
    radius: 0,
  });

  appMc.cellsDigit[x][y] = x + y * appMc.cellsColumnsAmount + 1;
  const digitX = appMc.cellsDigit[x][y] < 10 ? 30 : 20;

  appMc.cellsDigitWrap[x][y] = new createDigit({
    p: appMc.cells[x][y],
    tex: "digit",
    data: aDataDigit,
    num: 0,
    spacing: 0,
    x: digitX,
    y: 65,
    aling: "left",
    separate: false,
    snum: 0,
    pref: "",
    tint: 0xffffff,
  });

  appMc.cellsDigitWrap[x][y].update(appMc.cellsDigit[x][y]);
};

const initEmptyCell = () => {
  appMc.emptyCellIndexX = appMc.cellsRowsAmount - 1;
  appMc.emptyCellIndexY = appMc.cellsRowsAmount - 1;

  appMc.emptyCellContainer = new createContainer({
    p: appMc.mcGrid,
    x: appMc.emptyCellIndexX * (appMc.cellsSize + appMc.gridGap),
    y: appMc.emptyCellIndexY * (appMc.cellsSize + appMc.gridGap),
  });

  appMc.emptyCell = new createRect({
    p: appMc.emptyCellContainer,
    x: 0,
    y: 0,
    width: appMc.cellsSize,
    height: appMc.cellsSize,
    color: 0x2244aa,
    alpha: 1,
    fill: 1,
    radius: 0,
  });
};

const resetCells = () => {
  appMc.cellsContainer = [];
  appMc.cells = [];
  appMc.cellsDigitWrap = [];
  appMc.cellsDigit = [];

  for (let x = 0; x < appMc.cellsColumnsAmount; x++) {
    appMc.cellsContainer.push([]);
    appMc.cells.push([]);
    appMc.cellsDigitWrap.push([]);
    appMc.cellsDigit.push([]);
  }

  initEmptyCell();

  for (let x = 0; x < appMc.cellsColumnsAmount; x++) {
    for (let y = 0; y < appMc.cellsColumnsAmount; y++) {
      if (appMc.emptyCellIndexX === x && appMc.emptyCellIndexY === y) {
        continue;
      }

      initCell(x, y);
    }
  }
};

const startGame = () => {
  resetCells();
  shuffleCells();
  appMc.mcEnding.visible = false;
  appMc.mcStart.visible = false;
  appMc.gameStarted = true;
  initEnding();
};

